import styled from "styled-components";

export const DesktopContainer = styled.div`
  width: 100vw;
  height: calc(100% - 80px);
  padding: 10px;

  display: flex;
  align-content: flex-start;
  flex-direction: column;
  flex-wrap: wrap;
`;
